import React from "react";
import { Link } from "react-router-dom";

function Login({}) {
  return (
    <div className="sign">
      <p className="sign__title">Вход!</p>
      <form className="sign__form">
        <label htmlFor="username">Логин:</label>
        <input className="sign__input" required id="username" name="username" type="text" />
        <label htmlFor="password">Пароль:</label>
        <input className="sign__input" required id="password" name="password" type="password" />
        <div className="sign__button-container">
          <input type="submit" className="sign__input" value="Войти" />
        </div>
      </form>
    </div>
  );
}

export default Login;
